import React from 'react';
import { slide as Menu } from 'react-burger-menu';
import { NavLink } from 'react-router-dom';

/** Import assets */
import './sidebar.css';
import newsIcon from 'assets/images/sidebar/news.png';
import tipsIcon from 'assets/images/sidebar/tip.png';
class Sidebar extends React.Component {
  render() {
    const props = this.props;

    return (
      <Menu {...props} menuClassName="shadow-sm">
        <ul className="sidebar-menu-container card p-2 list-group list-group-flush text-center d-flex flex-column align-items-start shadow-md">
            <div className = "itemP"> <img src = {newsIcon} style = {{width:"30px",verticalAlign:"text-bottom", marginRight:"5px"}}/>News</div>
            <div className = "itemC">2019.09.05</div>
            <div className = "itemC">2019.09.06</div>
            <div className = "itemC">2019.09.07</div>
            <div className = "itemC">2019.09.08</div>
            <div className = "itemC">2019.09.09</div>
            <br/>
            <br/>
            <div className = "itemP"> <img src = {tipsIcon} style = {{width:"30px",verticalAlign:"text-bottom", marginRight:"5px"}}/>Tips</div>
            <div className = "itemC">Tip1</div>
            <div className = "itemC">Tip2</div>
            <div className = "itemC">Tip3</div>
            <div className = "itemC">Tip4</div>
            <div className = "itemC">Tip5</div>
            <div className = "itemC">Tip6</div>
        </ul>
      </Menu>
    );
  }
}

export default Sidebar;
